export const lookup = {
  "About Me!": {
    ispanel: true,
    type: "textarea",
    src: "",
    isrc: "about.png",
    text: 0,
  },
  "Linked-in": {
    ispanel: false,
    type: "link",
    src: "https://www.linkedin.com/in/calvin-lin-b25618143/",
    isrc: "linkedin.png",
  },
  Github: {
    ispanel: false,
    type: "link",
    src: "https://www.github.com/balbphegor",
    isrc: "github.png",
  },
  "how it all started": {
    ispanel: false,
    type: "link",
    src: "https://98.js.org/",
    isrc: "howitallstarted.png",
  },
  "celery man": {
    ispanel: true,
    type: "iframe",
    src: "https://www.youtube.com/embed/maAFcEU6atk",
    isrc: "celeryman.png",
  },
  monkey: {
    ispanel: true,
    type: "img",
    src: "monkey.jpeg",
    isrc: "monkey.png",
  },
};

const text_entries = [
  "Welcome to my site. I made this all by myself! I chose to stylize my website theme according to the Windows 98 theme, the first computer I put my grubby 3 year old fingers on. Instantly, I knew how to work the machine because the design was so intuitive. Released in 1998 (my birth-year) I figured that it would be quite fitting that I modelled my site after the first computer interface I ever laid my hands on. Please poke around! Everything is all hand-made and custom styled to my liking. I did not use any extraneous libraries besides React, which I use to dynamically create components for future scalability if I choose to return to this project. Each icon, task-bar element and window (bar the dragging functionality) was created by me with hand-written HTML, CSS, Javascript and React. ",
];
